const Navbar = () => {
   
    return (
    <div className='flex justify-center items-center my-5'>
            
      <div className='flex justify-around items-center space-x-4 text-2xl bg-purple-600 text-white p-3 rounded w-1/2'>
                <a href="#" className='hover:underline'>Tasks</a>
          <a href="#">Users</a>
          <a href="#">Add New User</a>

    </div>
    </div>
  )
}

export default Navbar
